    state = {
        employees : [
            {
                name: 'John',
                job: 'CEO'
            },
            {
                name: 'Jane',
                job: 'Manager'
            },
            {
                name: 'Michelle',
                job: 'Programer'
            },
            {
                name: 'Tim',
                job: 'Designer'
            },
        ]
};

    fireEmployee  = () => {};

    render(){

        return (
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Job</th>
                    </tr>
                </thead>
                <tbody>
                    {employees.map(employee => (
                            <Employee name={employee.name} job={employee.job} />
                        ))}
                </tbody>
            </table>
        );
    }
}

export default EmployeeList;
